import React from 'react'

export function ProjectLand({toggleTheme, theme, toggleLoading, loading}) {
  return (
    <>
      <div style={{
        width:'100%',
        height:'100vh',
        backgroundColor:'aqua',
      }}>
            <div style={{
                display:'flex',
                width:'60%',
                height:200,
                backgroundColor:'khaki',
                margin:'auto',
                justifyContent:'space-between',
                alignItems:'center',
                fontSize:24,
            }}>
                <div><button style={{
                    padding:'40px 140px',
                    border:'none',
                    borderRadius:15,
                    marginLeft:10,
                    fontSize:24,
                    fontFamily:'poppins',
                    backgroundColor:' #D4AF37',
                    boxShadow:'5px 5px grey',

                }}>Portfolio</button></div>
                <div><button  style={{
                    padding:'40px 140px',
                    border:'none',
                    borderRadius:15,
                    marginRight:10,

                }}>Case Studies</button></div>
            </div>
      </div>
    </>
  )
}
